import Head from 'next/head'
import React from "react";
import Backdrop from "./backdrop";

export default ({ showBackground, title = 'Ruthvik Konda' }) => (
    <div>
        <Head>
            <title>{title}</title>
            <meta charSet="utf-8" />
            <meta name="viewport" content="initial-scale=1.0, width=device-width" />
        </Head>
        <Backdrop/>
    </div>
)
